import React from "react";
import Cards from "./Cards";
import "./App.css";
import Sdata from "./Sdata";

// function ndata(val) {}

function App() {
  return (
    <>
      <h1 className="heading">
        Welcome to <span style={{fontWeight:''}}>slot Machine game</span>
      </h1>
      {Sdata.map((val, index) => {
        console.log(index);

        return (
          <Cards
            key={val.id}
            imgsrc={val.imgsrc}
            title={val.title}
            sname={val.sname}
            link={val.link}
          />
        );
      })}
    </>
  );
}

export default App;
